import React from 'react'

class Info extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <p>Welcome to Daily Task app!</p>
                    <p>This app helps you build your daily tasks.</p>
                    <p>You're able to set up timer to each of your tasks.</p>
                </div>
            </div>
        )
    }
}

export default Info
